import React, { Fragment } from 'react';
const Header = () => {
    return ( 
        <Fragment>
            <nav class="navbar navbar-light bg-light">
            <a class="navbar-brand" href="#">Lenspire</a>
            </nav>
        </Fragment>
     );
}
 
export default Header;
